import { 
  Container, 
  Typography, 
  Box, 
  Button,
  Grid,
  Card,
  CardContent
} from '@mui/material';
import { 
  KeyboardArrowRight, 
  Speed, 
  LocalGasStation, 
  Timer, 
  Star 
} from '@mui/icons-material';

function Home() {
  const features = [
    { icon: <Speed />, title: "Top Speed", value: "320 km/h" },
    { icon: <LocalGasStation />, title: "Engine", value: "V8 Twin-Turbo" },
    { icon: <Timer />, title: "0-100 km/h", value: "3.2s" },
    { icon: <Star />, title: "Rating", value: "5.0/5.0" }
  ];

  return (
    <Box sx={{ backgroundColor: '#171717', color: 'white', minHeight: '100vh' }}>
      {/* Hero Section */}
      <Box 
        sx={{ 
          pt: 12,
          pb: 8,
          background: 'linear-gradient(to bottom, #171717 0%, #262626 100%)',
        }}
      >
        <Container maxWidth="lg">
          <Grid container spacing={4} alignItems="center">
            <Grid item xs={12} md={6}>
              <Box sx={{ mb: 4 }}>
                <Typography 
                  variant="h1"
                  sx={{ 
                    fontWeight: 800,
                    fontSize: { xs: '2.5rem', md: '3.5rem' },
                    mb: 2,
                    background: 'linear-gradient(45deg, #dc2626 30%, #ef4444 90%)',
                    WebkitBackgroundClip: 'text',
                    WebkitTextFillColor: 'transparent',
                    lineHeight: 1.2
                  }}
                >
                  Experience Pure
                  <br />
                  Performance
                </Typography>
                <Typography 
                  variant="h5" 
                  sx={{ 
                    color: 'rgba(255,255,255,0.8)',
                    mb: 4,
                    fontWeight: 400
                  }}
                >
                  Discover our exclusive collection of premium vehicles designed for those who demand excellence.
                </Typography>
                <Box sx={{ display: 'flex', gap: 2 }}>
                  <Button 
                    variant="contained"
                    size="large"
                    endIcon={<KeyboardArrowRight />}
                    sx={{ 
                      backgroundColor: '#dc2626',
                      '&:hover': {
                        backgroundColor: '#b91c1c',
                        transform: 'translateY(-2px)',
                        boxShadow: '0 4px 12px rgba(220, 38, 38, 0.4)'
                      },
                      transition: 'all 0.2s ease-in-out'
                    }}
                  >
                    View Collection
                  </Button>
                  <Button 
                    variant="outlined"
                    size="large"
                    sx={{ 
                      color: 'white',
                      borderColor: 'rgba(255,255,255,0.5)',
                      '&:hover': {
                        borderColor: 'white',
                        backgroundColor: 'rgba(255,255,255,0.1)'
                      }
                    }}
                  >
                    Learn More
                  </Button>
                </Box>
              </Box>
            </Grid>
            <Grid item xs={12} md={6}>
              <Box sx={{ position: 'relative' }}>
                <Box
                  sx={{
                    position: 'absolute',
                    top: '50%',
                    left: '50%',
                    transform: 'translate(-50%, -50%)',
                    width: '300px',
                    height: '300px',
                    background: '#dc2626',
                    filter: 'blur(120px)',
                    opacity: 0.2,
                    zIndex: 0
                  }}
                />
                <img 
                  src="https://source.unsplash.com/random/800x600/?luxury-car"
                  alt="Luxury Car"
                  style={{ 
                    width: '100%',
                    height: 'auto',
                    borderRadius: '12px',
                    position: 'relative',
                    zIndex: 1
                  }}
                />
              </Box>
            </Grid>
          </Grid>
        </Container>
      </Box>

      {/* Features Section */}
      <Box sx={{ py: 8, backgroundColor: '#1a1a1a' }}>
        <Container maxWidth="lg">
          <Grid container spacing={4}>
            {features.map((feature, index) => (
              <Grid item xs={12} sm={6} md={3} key={index}>
                <Card 
                  sx={{ 
                    backgroundColor: '#262626',
                    color: 'white',
                    height: '100%',
                    transition: 'transform 0.2s',
                    '&:hover': {
                      transform: 'translateY(-8px)',
                      backgroundColor: '#2d2d2d'
                    }
                  }}
                >
                  <CardContent sx={{ textAlign: 'center' }}>
                    <Box sx={{ color: '#dc2626', mb: 2 }}>
                      {feature.icon}
                    </Box>
                    <Typography variant="h6" sx={{ mb: 1 }}>
                      {feature.title}
                    </Typography>
                    <Typography variant="h4" sx={{ color: '#dc2626', fontWeight: 'bold' }}>
                      {feature.value}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>

      {/* Featured Cars Section */}
      <Box sx={{ py: 8, backgroundColor: '#171717' }}>
        <Container maxWidth="lg">
          <Typography 
            variant="h2" 
            sx={{ 
              textAlign: 'center', 
              mb: 6,
              color: 'white',
              fontWeight: 'bold'
            }}
          >
            Featured Models
          </Typography>
          <Grid container spacing={4}>
            {[1, 2, 3].map((item) => (
              <Grid item xs={12} md={4} key={item}>
                <Card 
                  sx={{ 
                    backgroundColor: '#262626',
                    color: 'white',
                    transition: 'transform 0.2s',
                    '&:hover': {
                      transform: 'translateY(-8px)',
                      backgroundColor: '#2d2d2d'
                    }
                  }}
                >
                  <Box sx={{ position: 'relative', pt: '60%' }}>
                    <img 
                      src={`https://source.unsplash.com/random/800x600/?sports-car&sig=${item}`}
                      alt={`Luxury Car ${item}`}
                      style={{
                        position: 'absolute',
                        top: 0,
                        left: 0,
                        width: '100%',
                        height: '100%',
                        objectFit: 'cover'
                      }}
                    />
                  </Box>
                  <CardContent>
                    <Typography variant="h5" sx={{ mb: 1 }}>
                      Model {item}
                    </Typography>
                    <Typography sx={{ color: 'rgba(255,255,255,0.7)', mb: 2 }}>
                      Starting from $150,000
                    </Typography>
                    <Button 
                      variant="contained"
                      fullWidth
                      sx={{ 
                        backgroundColor: '#dc2626',
                        '&:hover': {
                          backgroundColor: '#b91c1c'
                        }
                      }}
                    >
                      Learn More
                    </Button>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
